"use strict";(self.webpackChunkdemo_blog_aurora=self.webpackChunkdemo_blog_aurora||[]).push([[364],{4261:(e,n,s)=>{s.r(n),s.d(n,{data:()=>a});const a={key:"v-211df360",path:"/WEB/220115.html",title:"使用git对GitHub拉取或推送文件时所遇到的问题及解决办法",lang:"zh-CN",frontmatter:{date:"2022/01/15 16:09",sticky:!0,keyword:"设置keyword,设置keyword,设置keyword,设置keyword",description:"关于Github代码推拉问题",title:"使用git对GitHub拉取或推送文件时所遇到的问题及解决办法",tag:["Git"],categories:["问题解决"]},excerpt:"",headers:[{level:3,title:"错误日志：",slug:"错误日志",children:[]}],git:{updatedTime:1642506318e3,contributors:[{name:"wuhao",email:"2637405542@qq.com",commits:4},{name:"Evan-WH",email:"2637405542@qq.com",commits:1}]}}},6609:(e,n,s)=>{s.r(n),s.d(n,{default:()=>l});var a=s(6252);const o=(0,a.uE)('<p>操作系统：Win10</p><p>网络加速：全局VPN</p><p>网络连接：手机热点（推送时不建议使用校园网）</p><h3 id="错误日志" tabindex="-1"><a class="header-anchor" href="#错误日志" aria-hidden="true">#</a> 错误日志：</h3><h4 id="_1、failed-to-connect-to-github-com-port-443-timed-out" tabindex="-1"><a class="header-anchor" href="#_1、failed-to-connect-to-github-com-port-443-timed-out" aria-hidden="true">#</a> 1、Failed to connect to github.com port 443: Timed out</h4><p>首先查看代理情况：</p><div class="language-json ext-json line-numbers-mode"><pre class="language-json"><code>git config --global --get http.proxy\ngit config --global --get https.proxy\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>有代理则清除代理，无代理则忽略:</p><div class="language-json ext-json line-numbers-mode"><pre class="language-json"><code>git config --global --unset http.proxy\ngit config --global --unset https.proxy\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>查看VPN运行端口：</p>',10),t=(0,a._)("p",null,[(0,a._)("img",{src:"https://ooszy.cco.vin/img/blog-public/ljz.gif",alt:"",originSrc:"https://s4.ax1x.com/2022/01/17/7amcjI.png",data:"aurora"})],-1),r=(0,a.uE)('<p>设置代理(端口为vpn运行时的本地端口)：</p><div class="language-json ext-json line-numbers-mode"><pre class="language-json"><code>git config --global http.proxy <span class="token number">127.0</span>.<span class="token number">0.1</span><span class="token operator">:</span><span class="token number">10889</span> 全局设置代理（推荐）\n\ngit config --local http.proxy <span class="token number">127.0</span>.<span class="token number">0.1</span><span class="token operator">:</span><span class="token number">10889</span>  单独设置代理\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><h4 id="_2、openssl-ssl-read-connection-was-reset-errno-10054" tabindex="-1"><a class="header-anchor" href="#_2、openssl-ssl-read-connection-was-reset-errno-10054" aria-hidden="true">#</a> 2、OpenSSL SSL_read: Connection was reset, errno 10054</h4><p>用git config 命令用来配置git的配置文件，通过<u>http.sslVerify false</u>全局来设置</p><div class="language-json ext-json line-numbers-mode"><pre class="language-json"><code>git config --global http.sslVerify <span class="token string">&quot;false&quot;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>如果这个问题解决后出现第一种情况：443超时，这个时候就使用第一种情况的解决方法，设置代理。当然，这是在使用VPN的环境下。普通环境下可能是网络的原因，可以尝试换个WIFI再优化网络</p>',6),i={},l=(0,s(3744).Z)(i,[["render",function(e,n){return(0,a.wg)(),(0,a.iD)(a.HY,null,[o,t,r],64)}]])}}]);